// src/components/Portfolio/Portfolio.js
import React from 'react';
import styles from './Portfolio.module.css';

function Portfolio() {
  return (
    <section className={styles.portfolio}>
      <div className={styles.portfolioContent}>
        <div className={styles.card}>
          <img src="/images/portfolio1.jpg" alt="Portfolio Item" className={styles.cardImg}/>
          <div className={styles.info}>
            <h3 className={styles.infoTitle}>Project One</h3>
            <p className={styles.infoText}>Short description of project one.</p>
          </div>
        </div>
        {/* Additional portfolio cards can be added here */}
      </div>
    </section>
  );
}

export default Portfolio;
